import React, { Component } from 'react'

class ArtistListItem extends Component {

    constructor(props) {
        super(props);

    }

  render() {
    const images = this.props.artist.image;
    const mediumImageArray = images[3];
    const artistImage = mediumImageArray[Object.keys(mediumImageArray)[0]]; 
    return (

      <li className="top-album" >
      <div className="item-info">
        <span className="album"> {this.props.artist.name}   </span> 
        {/* <span>{this.props.album.artist.name}</span> */}
        <span>{this.props.artist.playcount} Plays</span>
      </div>

        <img src={artistImage}/>
      </li>
    )
  }
}

export default ArtistListItem;
